#\!/usr/bin/env python3
"""
Test image data for PRig
Contains the base64 encoded test image (PNG format) for 4x6 printing.
"""

import base64
from pathlib import Path

# Base64 encoded PNG test image data (4x6 inches at 300 DPI)
TEST_IMAGE_BASE64 = """"""

def get_embedded_test_image() -> bytes:
    """Get the embedded test image as bytes."""
    return base64.b64decode(TEST_IMAGE_BASE64)

def save_embedded_test_image(output_path: Path) -> None:
    """Save the embedded test image to a file."""
    image_data = get_embedded_test_image()
    with open(output_path, "wb") as f:
        f.write(image_data)
